import React, { Component } from "react";

class Cars extends Component {
  constructor() {
    super();
    this.state = {
      cars: ["Ferrari", "Benz", "BMW", "Lombor", "Ford"],
    };
  }
  render() {
    const { cars } = this.state;
    return (
      <div>
        <h1>My Cars:</h1>
        {cars.map((car) => (
          <p>A car from {car} company</p>
        ))}
      </div>
    );
  }
}

export default Cars;
